        _getSubmitWorkflowIds: function (userId) {
            let that = this;
            let sListUrl = this.getPath("SF_1") +
                "/EmpWfRequest?$format=json&$filter=subjectId eq '" + userId + "' and eventReason like 'PSN%'&$top=1";

            $.ajax({
                url: sListUrl,
                type: "GET",
                dataType: "json",
                async: true,
                success: function (data) {
                    let listDataModel = that.getView().getModel("ListData").getData();
                    let combinedData = listDataModel.results;

                    if (!Array.isArray(combinedData)) {
                        console.error("ListData model 'results' is not an array.");
                        return;
                    }

                    if (!data || !data.d || !Array.isArray(data.d.results)) {
                        console.warn("Fetched workflow request data is empty or invalid.");
                        return;
                    }

                    let wfRequests = data.d.results;

                    combinedData.forEach(function (item) {
                        wfRequests.forEach(function (request) {
                            if (String(item.externalCode) === userId) {
                                if (request.wfRequestId) {
                                    if (!item.wfRequestNav) {
                                        item.wfRequestNav = { results: [] };
                                    }
                                    let wfEntry = {
                                        wfRequestId: request.wfRequestId,
                                        eventReason: request.eventReason,
                                        status: "position submitted"
                                    };

                                    item.wfRequestNav.results.push(wfEntry);
                                    item.positionStatus = "position submitted";
                                    that._fetchWorkflowDetails(request.wfRequestId, item);
                                }
                            }
                        });
                    });
                    that.getView().getModel("ListData").setData({ results: combinedData });
                    let positionWfModel = new sap.ui.model.json.JSONModel({
                        requests: wfRequests
                    });
                    that.getView().setModel(positionWfModel, "positionWfRequests");

                    console.log("✅ Matched position workflow requests with ListData:", combinedData);
                },
                error: function (xhr, status, error) {
                    MessageToast.show("Error fetching position workflow requests.");
                    console.error("Error fetching position workflow requests.");
                    console.error("Status:", status);
                    console.error("Error:", error);
                }
            });
        },


