        onChangeApprover1: function () {
            let wfRequestId;
            let sfPath;
            let requestType;
            let userId = this._currentUserId;
            BusyIndicator.show(0);

            try {
                if (!this._selectedItemContext) {
                    let oWfDataModel = this.getView().getModel("wfData_0");

                    if (!oWfDataModel) {
                        BusyIndicator.hide();
                        MessageBox.error("No workflow data available. Please select an item or refresh the view.");
                        return;
                    }

                    wfRequestId = oWfDataModel.getProperty("/wfRequestId");
                    requestType = "SubWfRequestId";

                    if (!wfRequestId) {
                        BusyIndicator.hide();
                        MessageBox.error("Please select an item from the list or ensure WF Request ID is available in the form.");
                        return;
                    }

                    let currentStepNum = oWfDataModel.getProperty("/currentStepNum");
                    sfPath = this._determineSFPathByStep(currentStepNum);
                } else {
                    let status = this._selectedItemContext.getProperty("wfRequestNav/results/0/status");

                    if (status === "PENDING") {
                        wfRequestId = this._selectedItemContext.getProperty("wfRequestNav/results/1/wfRequestId");
                        requestType = "ReqWfRequestId";

                        if (!wfRequestId) {
                            BusyIndicator.hide();
                            MessageBox.error("WF Request ID is missing for the selected pending item.");
                            return;
                        }

                        let currentStepNum = this._selectedItemContext.getProperty("wfRequestNav/results/0/currentStepNum");
                        sfPath = this._determi
                        neSFPathByStep(currentStepNum);
                    } else {
                        let oWfDataModel = this.getView().getModel("wfData_0");

                        if (!oWfDataModel) {
                            BusyIndicator.hide();
                            MessageBox.error("No workflow data available for this item.");
                            return;
                        }

                        wfRequestId = oWfDataModel.getProperty("/wfRequestId");
                        requestType = "SubWfRequestId";

                        if (!wfRequestId) {
                            BusyIndicator.hide();
                            MessageBox.error("WF Request ID is missing from the form data for this item.");
                            return;
                        }

                        let currentStepNum = oWfDataModel.getProperty("/currentStepNum");
                        sfPath = this._determineSFPathByStep(currentStepNum);
                    }
                }

                console.log("Attempting to approve workflow:", {
                    wfRequestId: wfRequestId,
                    path: sfPath,
                    requestType: requestType,
                    userId: userId
                });

                let url = this.getPath(sfPath) + `/approveWfRequest?wfRequestId=${wfRequestId}L`;

                $.ajax({
                    url: url,
                    type: "POST",
                    dataType: "xml",
                    success: function (data) {
                        try {

                            let statusElement = $(data).find("d\\:status, status");
                            let wfRequestIdElement = $(data).find("d\\:wfRequestId, wfRequestId");

                            if (statusElement.length > 0 && statusElement.text() === "success") {
                                let responseWfRequestId = wfRequestIdElement.length > 0 ? wfRequestIdElement.text() : wfRequestId;

                                MessageBox.success(`Workflow request ${responseWfRequestId} approved successfully.`, {
                                    onClose: function () {
                                        window.location.reload();
                                    }
                                });
                            } else {
                                BusyIndicator.hide();
                                MessageBox.warning("Approval response received but status was not successful.", {
                                    title: "Warning"
                                });
                            }
                        } catch (parseError) {
                            console.error("Error parsing success response:", parseError);
                            BusyIndicator.hide();

                            MessageToast.show("Workflow request approved successfully.");
                            window.location.reload();
                        }
                    },
                    error: function (jqXHR, textStatus, errorThrown) {
                        BusyIndicator.hide();
                        let errorMessage = "Error approving workflow request: " + errorThrown;

                        if (jqXHR.responseJSON && jqXHR.responseJSON.error?.message?.value) {
                            errorMessage = "Error approving workflow request: " + jqXHR.responseJSON.error.message.value;
                        } else if (jqXHR.responseXML) {
                            try {
                                let xmlDoc = jqXHR.responseXML;
                                let messageElement = xmlDoc.querySelector("message");
                                if (messageElement) {
                                    errorMessage = "Error approving workflow request: " + messageElement.textContent;
                                }
                            } catch (xmlParseError) {
                                console.error("Error parsing XML response:", xmlParseError);
                            }
                        } else if (jqXHR.responseText) {
                            try {
                                let responseObj = JSON.parse(jqXHR.responseText);
                                if (responseObj.error && responseObj.error.message) {
                                    errorMessage = "Error: " + responseObj.error.message;
                                }
                            } catch (e) {
                                errorMessage = "Error approving workflow request: " + jqXHR.responseText;
                            }
                        }

                        MessageBox.error(errorMessage, {
                            title: "Error",
                            details: jqXHR.responseText
                        });
                        console.error("Error approving workflow request:", textStatus, errorThrown, jqXHR);
                    }
                });
            } catch (ex) {
                BusyIndicator.hide();
                MessageBox.error("An unexpected error occurred: " + ex.message);
                console.error("Exception in onApproveWfRequest:", ex);
            }
        },

