        _updatePositionStatus: function (wfRequestId, status, callback) {
            let userId = this._currentUserId;

            if (!userId) {
                console.error("User ID not available for updating position status");
                MessageToast.show("Error: User ID not available");
                return;
            }
            let oDataModel = this.getView().getModel("DataModel");
            let aChangeOfStatus = oDataModel.getProperty("/ChangeOfStatus");

            // Find the row for "Job Title"
            let oJobTitleRow = aChangeOfStatus.find(function (row) {
                return row.Item === "Job Title";
            });

            let sSelectedJobTitle = oJobTitleRow ? oJobTitleRow.NewStatus : "";
            let sEffectiveDate = this._currentEffectiveDate || new Date().toISOString().split('T')[0];

            // Create the payload for updating position status
            let oPayloadData = {
                "__metadata": {
                    "uri": "PositionUpdate"
                },
                "userId": userId,
                "wfRequestId": wfRequestId,
                "jobTitle": sSelectedJobTitle,
                "effectiveDate": sEffectiveDate,
                "status": status
            };

            let sUrl = this.getPath("SF_6") + "/updatePositionStatus";

            $.ajax({
                url: sUrl,
                type: "POST",
                contentType: "application/json",
                data: JSON.stringify(oPayloadData),
                success: function (data) {
                    console.log("Position status updated successfully:", data);
                    MessageToast.show("Position status updated to: " + status);

                    if (typeof callback === "function") {
                        callback();
                    }
                },
                error: function (xhr, textStatus, errorThrown) {
                    let errorMessage = "Error updating position status: " + errorThrown;

                    if (xhr.responseJSON && xhr.responseJSON.error) {
                        errorMessage = "Error: " + xhr.responseJSON.error.message.value;
                    }

                    console.error("Error updating position status:", errorMessage);
                    MessageBox.error(errorMessage);
                }
            });
        },

