        getCurrentDropdownValue: function (sNo) {
            let dataModel = this.getView().getModel("DataModel");
            let changeOfStatusData = dataModel.getProperty("/ChangeOfStatus");

            if (changeOfStatusData && changeOfStatusData.length > 0) {
                let item = changeOfStatusData.find(item => item.SNo === sNo);
                if (item && item.CurrentStatus) {
                    // Extract the code part before " - "
                    let currentStatusParts = item.CurrentStatus.split(" - ");
                    return currentStatusParts[0].trim();
                }
            }
            return null;
        },

