        _getUserIdAndOpenAddComponentDialog: function () {
            let userId = null;
            let cust_EffectiveDate = null;
            let cust_PSNEffectiveDate = null;
            let psnTypeChange = null; // New letiable to store cust_PSNTypeChange
            let that = this;

            return new Promise(function (resolve, reject) {
                let oList = that.byId("idList");
                let oSelectedItem = oList.getSelectedItem();

                if (!oSelectedItem) {
                    MessageToast.show("No record selected. Please select a record first.");
                    console.error("No record selected for opening Add Component dialog");
                    reject(new Error("No record selected"));
                    return;
                }

                let oSelectedContext = oSelectedItem.getBindingContext("ListData");

                if (!oSelectedContext) {
                    MessageToast.show("Invalid selection. Cannot retrieve data.");
                    console.error("Invalid selection context for opening Add Component dialog");
                    reject(new Error("Invalid selection context"));
                    return;
                }

                let oSelectedData = oSelectedContext.getObject();

                userId = oSelectedData.externalCode;
                psnTypeChange = oSelectedData.cust_PSNTypeChange;
                if (oSelectedData.cust_EffectiveDate) {
                    let timestamp = parseInt(oSelectedData.cust_EffectiveDate.replace("/Date(", "").replace(")/", ""));
                    let date = new Date(timestamp);
                    cust_EffectiveDate = date.getFullYear() + "-" +
                        String(date.getMonth() + 1).padStart(2, '0') + "-" +
                        String(date.getDate()).padStart(2, '0');

                    cust_PSNEffectiveDate = oSelectedData.cust_EffectiveDate;
                }

                console.log("Retrieved from selected list item - userId:", userId, "cust_EffectiveDate:", cust_EffectiveDate, "psnTypeChange:", psnTypeChange);

                if (!userId || !cust_EffectiveDate || !psnTypeChange) {
                    MessageToast.show("Could not retrieve user ID, effective date, or PSN Type Change from selection.");
                    console.error("Could not retrieve user ID, effective date, or PSN Type Change from selection");
                    reject(new Error("Could not retrieve user data"));
                    return;
                }

                that._currentUserId = userId;
                that._currentPSNEffectiveDate = cust_PSNEffectiveDate;
                that._currentEffectiveDate = cust_EffectiveDate;
                that._currentPsnTypeChange = psnTypeChange; // Store the fetched value

                resolve();
            });
        },

