        onUpdatePosition: async function () {
            // Show busy indicator
            const oBusyDialog = new sap.m.BusyDialog({
                text: "Loading employee data..."
            });
            oBusyDialog.open();
        
            try {
                let userId = null;
        
                if (this._selectedItemContext) {
                    let selectedRowData = this._selectedItemContext.getObject();
                    userId = selectedRowData.externalCode;
                } else if (this.oSelectedRowModel && this.oSelectedRowModel.getData().selectedRow) {
                    userId = this.oSelectedRowModel.getData().selectedRow.externalCode;
                }
        
                if (!userId) {
                    MessageToast.show("No employee selected. Please select an employee first.");
                    console.error("No user ID available for onUpdatePosition");
                    return;
                }
        
                console.log("Updating position for user:", userId);
        
                // Execute all async operations with individual error handling
                try {
                    await this.fetchEmpJobData(userId);
                } catch (error) {
                    console.error("Error fetching employee job data:", error);
                    throw new Error("Failed to fetch employee job data");
                }
        
                try {
                    await this.callCompensationFlow();
                } catch (error) {
                    console.error("Error calling compensation flow:", error);
                    throw new Error("Failed to load compensation data");
                }
        
                try {
                    await this.fetchRequestApprovalData(userId);
                } catch (error) {
                    console.error("Error fetching request approval data:", error);
                    throw new Error("Failed to fetch approval data");
                }
        
                try {
                    await this._getEventReasons();
                } catch (error) {
                    console.error("Error fetching event reasons:", error);
                    throw new Error("Failed to fetch event reasons");
                }
        
                try {
                    await this._getWorkflowDetails(userId);
                } catch (error) {
                    console.error("Error fetching workflow details:", error);
                    throw new Error("Failed to fetch workflow details");
                }
        
                try {
                    await this.initializeView();
                } catch (error) {
                    console.error("Error initializing view:", error);
                    throw new Error("Failed to initialize view");
                }
        
                // Refresh data model
                this.getView().getModel("DataModel").refresh(true);
                
                let selectedRowData = this._selectedItemContext.getObject();
                if (this.empJobData) {
                    if (selectedRowData && selectedRowData.recordStatus !== "PENDINGHISTORY") {
                        await this.initializeView();
                    } else if (selectedRowData && selectedRowData.recordStatus === "PENDINGHISTORY") {
                        // Handle pending history case
                        console.log("Record status is PENDINGHISTORY");
                    }
                } else {
                    throw new Error("Employee job data is not available after loading");
                }
        
                MessageToast.show("Employee data loaded successfully");
        
            } catch (error) {
                console.error("Error in onUpdatePosition:", error);
                
                // Show user-friendly error message
                let errorMessage = "Failed to load employee data. Please try again.";
                if (error.message) {
                    errorMessage = error.message;
                }
                
                MessageToast.show(errorMessage);
                
                // Optionally show more detailed error in a MessageBox
                sap.m.MessageBox.error(
                    errorMessage + "\n\nPlease contact support if the problem persists.",
                    {
                        title: "Error Loading Data",
                        details: error.stack || error.toString()
                    }
                );
        
            } finally {
                // Always close busy dialog
                oBusyDialog.close();
            }
        },


