        onGeneratePDF: function () {
            let oList = this.byId("idList");
            let oSelectedItem = oList.getSelectedItem();

            if (!oSelectedItem) {
                sap.m.MessageToast.show("Please select an employee from the list first");
                return;
            }
            let oModel = this.getView().getModel("ListData");
            let sPath = oSelectedItem.getBindingContextPath();
            let oSelectedRowData = oModel.getProperty(sPath);
            let eventType = oSelectedRowData?.cust_PSNTypeChange;

            if (!eventType) {
                sap.m.MessageToast.show("Event type not found for selected employee");
                return;
            }

            try {
                let docDefinition = this._createDocumentDefinition(eventType);
                pdfMake.createPdf(docDefinition).download('employee-letter.pdf');
            } catch (error) {
                console.error("Error generating PDF:", error);
                sap.m.MessageToast.show("Error generating PDF. Please try again.");
            }
        },


